import { useState } from 'react';
import './App.css';
import FilePreview from './FilePreview';

function showPreview(file) {
  console.log(file);
}

function App() {
  const [style, setStyle] = useState("fadeIn");

  const toggleFade = () => {
    if (style === "fadeOut") {
      setStyle("fadeIn");
    } else {
      setStyle("fadeOut");
    }
  }

  return (
    <div className="App">
      <FilePreview />
      {/* <div className={style}>
